  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:33.094362\",\n\t\"name\": \"agassiz-national-wildlife-refuge-narrative-report-calendar-year-1970\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Agassiz
  National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
  year.  The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, fish, reptiles, and diseases- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, collections
  and receipts, vegetation control, and prescribed burning. Resource management is
  outlined; topics include grazing, haying, and fur harvesting. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
